    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 + - col1 BETWEEN + - col2 - + col2 + + 66 * + 94 AND 42;
  - name: tab1

outputs:
  - name: q3286.out
    data: |
      51	14	96
      85	5	59
      91	47	68
